import React from 'react';
import { Container, Grid, Button } from 'semantic-ui-react'

function App() {
  return (
    <div className="App">
      <Container>
        <Grid columns={2} relaxed="very" stackable>
          <Grid.Column>
            <Button content="Search" />
          </Grid.Column>
          <Grid.Column>

          </Grid.Column>
        </Grid>
      </Container>
    </div>
  );
}

export default App;
